import React, { useEffect } from 'react'
import { useDispatch } from 'react-redux'
import { fetchHomeData } from '../../store/slices/homeSlice'

const HomePageData = () => {

    const dispatch = useDispatch();

    useEffect(() => {
        fetchHomeData(dispatch)
    }, [dispatch])

    return (
        <>
            <h1>HomePage</h1>
        </>
    )
}

export default HomePageData
